import React from 'react';
import './footer.css'; // Importa el archivo CSS

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <div className="logo">
          {/* Aquí puedes agregar el logo de la empresa */}
          {/* Ejemplo: <img src="/ruta/a/tu/logo.png" alt="Logo Empresa" /> */}
        </div>
        <div className="info">
          {/* Aquí puedes agregar información adicional, como la dirección de la empresa */}
          <p>Dirección de la empresa</p>
          <p>Teléfono: 123-456-7890</p>
          <p>Email: info@empresa.com</p>
        </div>
      </div>
      <div className="legal">
        <div className="privacy">
          {/* Aquí puedes agregar el enlace a la política de privacidad */}
          <a href="/politica-de-privacidad">Política de privacidad</a>
        </div>
        <div className="cookies">
          {/* Aquí puedes agregar el enlace a la política de cookies */}
          <a href="/politica-de-cookies">Política de cookies</a>
        </div>
      </div>
      <div className="copyright">
        <p>© {new Date().getFullYear()} Empresa de Ciberseguridad. Todos los derechos reservados.</p>
      </div>
    </footer>
  );
};

export default Footer;
